DROP TABLE IF EXISTS `clientes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `clientes` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'chave primaria da tabela e codigo de cada cliente',
  `nome` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'nome do cliente',
  `celular` varchar(11) COLLATE utf8_unicode_ci NOT NULL COMMENT 'numero de telefone do cliente',
  `saldo` decimal(2,0) NOT NULL DEFAULT '0' COMMENT 'saldo do cliente',
  `habilitado` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'status do cliente',
  `codigo_estado` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'referencia do codigo do estado de entrega',
  `codigo_municipio` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'referencia do codigo do municipio de entrega',
  `codigo_bairro` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'referencia do codigo do bairro de entrega',
  `endereco` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'endereço de entrega da compra',
  `complemento` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'complemento de endereço ',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='tabela com informações dos clientes';
