--
-- Table structure for table `produtos`
--

DROP TABLE IF EXISTS `produtos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `produtos` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'autonumerico chave primaria da tabela',
  `descricao` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'nome do produto\n',
  `pronuncia` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'leitura da descrição\n',
  `img` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'url -jpg\n',
  `codigo_loja` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT 'numero de codigo interno da loja\\n',
  `custo_unitario` double NOT NULL DEFAULT '0' COMMENT 'valor de custo do produto\\\\n',
  `valor_venda` double NOT NULL DEFAULT '0' COMMENT 'valor de venda do produto\\\\n',
  `valor_promocao` double NOT NULL DEFAULT '0' COMMENT 'valor de promoção do produto\\\\n',
  `gramatura` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '1,5L  - 50ml (sem espaço e maiusculo) kg - gr - lt - ml - und\n',
  `embalagem` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'PCT - UND - CX - PESO\n',
  `peso` varchar(5) COLLATE utf8_unicode_ci NOT NULL COMMENT '01526 (01,526kg)\n',
  `iguala_produto` int(11) NOT NULL DEFAULT '0' COMMENT '0 - 1 - 2 -3 \nserve para realizar alteração em produtos iguais',
  `itens_caixa` int(11) NOT NULL DEFAULT '0' COMMENT 'quantidade de produto  na caixa\n',
  `volume` int(11) NOT NULL DEFAULT '0' COMMENT '30 - caixa volume =100 (cabe 3 na caixa)volume do produto\n',
  `validade` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'se o produto é perecivel ou nao\n',
  `informacao` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'informação nutricional do produto\n',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=736 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='tabela com os dados dos produtos';
/*!40101 SET character_set_client = @saved_cs_client */;

